INSERT INTO `ec_reviews` VALUES (1,7,NULL,NULL,4,1.00,'Good app, good backup service and support. Good documentation.','published','2024-05-24 01:20:45','2024-05-24 01:20:45','[\"products\\/product-9.jpg\",\"products\\/product-10.jpg\",\"products\\/product-11.jpg\",\"products\\/product-55.jpg\"]'),(2,10,NULL,NULL,39,1.00,'Those guys now what they are doing, the release such a good product that it\'s a pleasure to work with ! Even when I was stuck on the project, I created a ticket and the next day it was replied by the team. GOOD JOB guys. I love working with them :)','published','2024-05-24 01:20:45','2024-05-24 01:20:45','[\"products\\/product-22.jpg\"]'),(3,10,NULL,NULL,56,2.00,'Great system, great support, good job Botble. I\'m looking forward to more great functional plugins.','published','2024-05-24 01:20:45','2024-05-24 01:20:45','[\"products\\/product-21.jpg\",\"products\\/product-71.jpg\"]'),(4,1,NULL,NULL,37,2.00,'Amazing code, amazing support. Overall, im really confident in Botble and im happy I made the right choice! Thank you so much guys for coding this masterpiece','published','2024-05-24 01:20:45','2024-05-24 01:20:45','[\"products\\/pla-product-03.jpg\",\"products\\/product-55.jpg\",\"products\\/product-95.jpg\"]'),(5,10,NULL,NULL,4,2.00,'Great system, great support, good job Botble. I\'m looking forward to more great functional plugins.','published','2024-05-24 01:20:45','2024-05-24 01:20:45','[\"products\\/product-86.jpg\"]'),(6,1,NULL,NULL,46,2.00,'The code is good, in general, if you like it, can you give it 5 stars?','published','2024-05-24 01:20:45','2024-05-24 01:20:45','[\"products\\/product-36.jpg\",\"products\\/product-94.jpg\"]'),(7,6,NULL,NULL,41,1.00,'We have received brilliant service support and will be expanding the features with the developer. Nice product!','published','2024-05-24 01:20:45','2024-05-24 01:20:45','[\"products\\/product-18.jpg\"]'),(8,6,NULL,NULL,66,2.00,'Clean & perfect source code','published','2024-05-24 01:20:45